// so evertime I use the Container or Card component I get an error: Uncaught Error: Invalid hook call.
// OK so I was importing from "@mui/core" instead of "@mui/material"
function Services(){
    return(
        <Container>
            <Grid container spacing={5}
            justifyContent="center"
            alignItems="center">
                <Grid item xs={6} md={4}> 
                    <Card>
                        <CardHeader
                            title={'Basic'}
                            variant='h3'
                            sx={{
                                backgroundColor: '#00FFFF',
                                color: '#3F00FF'
                            }}
                        />
                        <CardContent>
                            <Box>
                                <Typography variant='h4'>
                                    $45
                                </Typography>
                            </Box>
                        </CardContent>

                    </Card>
                </Grid>
                <Grid item xs={6} md={4}>
                    <Card>
                        <CardHeader
                            title={'Pro'}
                            variant='h3'
                            sx={{
                                backgroundColor: '#00FFFF',
                                color: '#3F00FF'
                            }}

                        />
                        <CardContent>
                            <Box>
                                <Typography variant='h4' >
                                    $55
                                </Typography>
                            </Box>
                        </CardContent>
                    </Card>
                </Grid>

            </Grid>
        </Container>


    )
}
export default Services;
